import React, {useEffect} from 'react';
import HomeButton from '../buttons/HomeButton.js';

export default function Logout(logoutProps) {

    const handleLogout = () => {
        localStorage.clear()
        this.props.handleStateChange("token", null)
    }

    useEffect(() => {
        handleLogout
    })

    return (
        <div>
            You've been logged out! Yeah, you. You good-lookin, noodle-lovin, chopstick ninja. Stay Dope. 
            <HomeButton/>
        </div>
    );
}
